(129, 'Bennyhearf', 'olegivanover2@gmail.com', 'Free weight loss 15 kg for 1 month! -->  http://weightlosstrue.freecluster.eu/ \r\n<a href=\"http://weightlosstrue.freecluster.eu/?lol=1\">Free weight loss</a> <a href=http://weightlosstrue.freecluster.eu/?lol=1>Detail</a>:  <a href=http://weightlosstrue.freecluster.eu/?lol=1>Free weight loss</a> \r\n \r\nDiet and weight loss \r\n \r\nStudies have shown that just about any diet will result in weight loss, if itâ€™s one that someone can follow.1,2 Esteemed Yale physician and nutrition expert David Katz examined over 58 popular diets and found that the most successful in terms of both weight loss and nutrition consist of â€œreal food.â€ By that he means plants, whole grains, nuts and seeds, as well as meat (ideally, from animals that ate plants). Basically, foods closer to nature. The other key is minimizing processed foods, including sugars and flours.3 \r\n \r\nWithout realizing it, I followed Katzâ€™s advice: I ate mostly fruits and vegetables, nuts, seeds, and dairy. I occasionally had whole grains like quinoa or farro, even rice or corn chips. And, of course, an occasional treat. But I had sworn off sugars and flours, for the most part. \r\nBehavior change and weight loss \r\n \r\nItâ€™s hard to keep track of how much we eat. But a lot of research shows that when we keep track of intake, we eat less. This is called self-monitoring, and why writing down what I ate and weighed helped me.4,5,6 There are so many ways to do this nowadays: from the old-school paper-and-pencil method, to apps like MyFitnessPal, or the Weight Watchers points system.7 \r\n \r\nAnother key approach: forgive your failures. Studies show that people who â€œmess upâ€ their diet plan and then â€œgive upâ€ end up gaining, while people who forgive themselves and move on continue to lose. Itâ€™s called self-acceptance.8,9 Look, weâ€™re human. Birthdays, office parties, weddings, random movie nights: they happen, and we celebrate by having the amazing chocolate cake, or Betsyâ€™s famous buffalo chicken dip, waaaay too much champagne, or buttered popcorn. Expect this, enjoy, and then move on. \r\nExercise and weight loss \r\n \r\nMost major weight loss is followed by weight gain, as people revert to their old habits. But, some folks manage to keep it off. How do they do it? Researchers have found that maintaining a healthy diet, ongoing self-monitoring, plenty of self-acceptance, as well as a high level of physical activity are all associated with keeping the pounds off.10 \r\n \r\nWhen I feel like Iâ€™m slipping, I start logging again. Nowadays, I use an online fitness app on my phone to more easily keep track of my daily food intake. Red wine and dark chocolate are always in stock in our house, and thatâ€™s OK. Exercise is important, too, but in my book, any and all physical activity counts. Two or three workouts a week help me maintain muscle tone and cardiovascular fitness. If I canâ€™t get to the gym, I run. If I canâ€™t run, I do something at home, like five minutes of in-place kickboxing moves, or dancing around the living room like a crazy person with my kids. I take the stairs wherever I am as often as possible. I use a carry basket at the grocery store, and switch from arm to arm while I shop: biceps curls! Hey, it all counts. \r\nStaying at a healthy weight for life \r\n \r\nThe old adage is â€œeat less, exercise more,â€ and this is still true, to some extent. But human beings are psychologically and sociologically complex creatures, and that adage is a lot harder to follow than it sounds. For average adults who do not have contributing medical or psychological issues, a nutritious plant-based diet low in processed foods and carbohydrates, consistent self-monitoring of intake and progress, forgiving oneself when expected lapses occur, all combined with regular physical activity, can result in weight loss for life.'),
